            var obj = {};

        fetch("thedata.json")
            .then(r => {
                return r.text()
            })
            .then(a => {
                var arr = JSON.parse(a);
                console.log(arr);
                for (let b of arr) {
                    var obj = {}
                    obj.category = b.searchTerm.replace(/,/ig, " ");;
                    obj.link = b.href;
                    obj.name = b.ih.replace(/,/ig, " ");;
                    if (obj.category == "search") {
                        obj.category = "general google search";
                    }
                    harr.push(obj);
                }
                var csv = "link,name,category\n";
                for (let c of harr) {
                    csv += `${c.link},${c.name},${c.category}\n`;
                }
                downloadPie(csv);
            })

        function downloadPie(text) {
            var m = [];
            m[0] = text;
            var myBlob = new Blob(m, { type: 'text/html' });
            var blobUrl = URL.createObjectURL(myBlob);
            var link = document.createElement("a");
            link.href = blobUrl;
            link.download = "11000 HR folks.csv";
            link.innerHTML = "<button>Download " + link.download + "</button>";
            link.click();
        }
